import React from "react";
import "./styles.scss";

export function Header() {
  return (
    <div className="header">
      <div className="header__links row">
        <h2 className="header__links__app">Shortly</h2>
        <p className="header__links__name">Features</p>
        <p className="header__links__name">Pricing</p>
        <p className="header__links__name">Ressources</p>
      </div>
      <div className="header__auth row">
        <p className="header__auth__login">Login</p>
        <button className="header__auth__signup">Sign Up</button>
      </div>
    </div>
  );
}
